import React from 'react';
import house_bg from './img/house_bg.jpg';
import business_bg from './img/business_bg.jpg';
import farmy_bg from './img/farmy_bg.jpg';

import './Offer.css';

const Offer = () => {
  return (
    <div className="main__section">
      <div className="container">
        <h2>Oferta</h2>
        <div className="offers">
          <div className="offer__home">
            <img src={house_bg} alt="house plate" />
            <h3>Dla domu</h3>
            <p></p>
          </div>
          <div className="offer__business">
            <img src={business_bg} alt="business plate" />
            <h3>Dla biznesu</h3>
            <p></p>
          </div>
          <div className="offer__farmy">
            <img src={farmy_bg} alt="famy plate" />
            <h3>Farmy PV</h3>
            <p></p>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Offer;
